DROP DATABASE IF EXISTS DBE2;
CREATE DATABASE DBE2 CHARSET=utf8mb4 COLLATE=utf8mb4_bin;
use DBE2;

create table tbl1 (
  fld10 char(3) primary key,
  fld11 int,
  fld12 int,
  fld13 varchar(100),
  fld14 date
) ENGINE=InnoDB;

create table tbl2 (
  fld21 int primary key,
  fld22 char(3),
  fld23 int,
  fld24 varchar(100),
  foreign key (fld22) references tbl1(fld10)
) ENGINE=InnoDB;

create table testcoll (
  `seq` int(11) PRIMARY KEY AUTO_INCREMENT,
  `fld1` varchar(100) CHARSET utf8 COLLATE utf8_bin,
  `fld2` varchar(100),
  `fld3` varchar(100) COLLATE utf8mb4_unicode_ci
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

create table userInfoBad (
  username varchar(20) primary key,
  password varchar(20) NOT NULL,
  realname varchar(20),
  secret varchar(100)
) ENGINE=InnoDB;
  
create table userInfo (
  username varchar(20) primary key,
  hashed varchar(100) NOT NULL,
  salt varchar(100) NOT NULL,
  realname varchar(20),
  secret varchar(100)
) ENGINE=InnoDB;

