CREATE TABLE 利用者(
  利用者ID CHAR(8) PRIMARY KEY,
  氏名 VARCHAR(20) NOT NULL,
  氏名カタカナ VARCHAR(30) NOT NULL,
  性別 CHAR(1) NOT NULL,
  電話番号 VARCHAR(20),
  メールアドレス VARCHAR(50),
  郵便番号 VARCHAR(8),
  住所1 VARCHAR(4),
  住所2 VARCHAR(10),
  住所3 VARCHAR(10),
  住所4 VARCHAR(20),
  住所5 VARCHAR(40),
  生年月日 DATE
) ENGINE=InnoDB;

CREATE TABLE 書籍 (
    書籍ID CHAR(8) PRIMARY KEY,
    タイトル VARCHAR(300) NOT NULL,
    巻次  VARCHAR(150),
    シリーズ  VARCHAR(100),
    版表示 VARCHAR(80),
    著者 VARCHAR(200),
    出版者 VARCHAR(100),
    出版年 VARCHAR(30),
    冊数等 VARCHAR(100)
) ENGINE=InnoDB;

CREATE TABLE 貸出(
  貸出ID INT PRIMARY KEY AUTO_INCREMENT,
  利用者 CHAR(8) NOT NULL,
  書籍 CHAR(8) NOT NULL,
  貸出日 DATE NOT NULL,
  返却予定日 DATE NOT NULL,
  返却日 DATE DEFAULT NULL,
  FOREIGN KEY (利用者) REFERENCES 利用者(利用者ID),
  FOREIGN KEY (書籍) REFERENCES 書籍(書籍ID)
) ENGINE=InnoDB;

